import httpClient from "@/utils/httpclient";
import model from "@/components/model";
import myMap from '@/components/map';
export default {
  name: "testPointDetail",
  components: {
    myMap: myMap,
    model: model
  },
  data: function data() {
    return {
      data: {},
      map: {},
      show: false,
      btnGroup: {
        btnFirst: this.$t('m.tip.b_cancel'),
        btnSecond: this.$t('m.tip.b_ok')
      }
    };
  },
  mounted: function mounted() {
    this.initData();
  },
  methods: {
    initData: function initData() {
      var _this = this;

      httpClient.get('/api/v1/clouddrive/parkinglot/detail?parkingid=' + this.$route.params.id).then(function (res) {
        if (res.data.code == 200 && res.data.data) {
          _this.data = res.data.data;
          _this.map = {
            lat: res.data.data.centerCoordinate.split(" ")[1],
            lng: res.data.data.centerCoordinate.split(" ")[0],
            area: res.data.data.areaCoordinate,
            vehicleInfo: {}
          };
        }
      });
    },
    delPoint: function delPoint() {
      this.show = true;
    },
    hideTip: function hideTip(type) {
      var _this2 = this;

      if (type) {
        httpClient.post('/api/v1/lot/delete', {
          id: this.$route.params.id
        }).then(function (response) {
          if (response.data.code == 200) {
            _this2.$router.push("/test-drive/test-point");
          }
        });
      }

      this.show = false;
    }
  }
};
